import styled from "styled-components";

export const StyledFooter = styled.footer`
  left: 0;
  bottom: 0;
  width: 100%;
  background-color: "#FF0000";
  color: "#FF0000";
  text-align: center;
  position: "fixed";
  margin-left: auto;
`;
